import React, { useContext } from 'react';
import './portfolio.css';
import { Swiper, SwiperSlide } from 'swiper/react';
import 'swiper/css';
import 'swiper/css/navigation';
import 'swiper/css/pagination';
import 'swiper/css/autoplay';
import 'swiper/css/parallax';
import 'swiper/css/effect-cards';

// Importing Swiper modules directly from Swiper
import SwiperCore, { Navigation, Pagination, Autoplay, Parallax, EffectCards } from 'swiper';

// Import images
import Ecom from '../assets/img/ecommerce.png';
import Music from '../assets/img/musicapp.png';
import Hoc from '../assets/img/hoc.png';
import Trade from '../assets/img/tradeapp.jpeg';
import { themeContext } from "../Context";

// Installing the modules
SwiperCore.use([Navigation, Pagination, Autoplay, Parallax, EffectCards]);

const Portfolio = () => {
  const theme = useContext(themeContext);
  const darkTheme = theme.state.darkmode;

  return (
    <div className="ProjectsSwiper" id="Projects">
      <span style={{ color: darkTheme ? 'white' : 'black' }}>My Recent</span>
      <span>Projects</span>

      <Swiper
        spaceBetween={30} // Space between slides
        slidesPerView={2.5} // Number of slides per view
        grabCursor={true} // Enable cursor grab
        navigation={true} // Enable navigation
        pagination={{ clickable: true }} // Enable clickable pagination
        autoplay={{ delay: 2500 }} // Enable autoplay with delay
        parallax={true} // Enable parallax effect
        effect="cards" // Enable card effect
        className="ProjectsSwiper-slider"
      >
        <SwiperSlide>
          <img src={Ecom} alt="E-commerce project" />
        </SwiperSlide>
        <SwiperSlide>
          <img src={Music} alt="Music App project" />
        </SwiperSlide>
        <SwiperSlide>
          <img src={Hoc} alt="HOC project" />
        </SwiperSlide>
        <SwiperSlide>
          <img src={Trade} alt="Trade App project" />
        </SwiperSlide>
      </Swiper>
    </div>
  );
}

export default Portfolio;
